import React, {useState} from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';

const Navigation = () => {
  const [logged, setLogged] = useState(true);
  const [isAdmin, setAdmin] = useState(false);
  return (
    <Navbar bg="dark" variant="dark">
      <Container>
        <Navbar.Brand>Logo aplikacji</Navbar.Brand>
        <Nav>
          {logged && <Nav.Link href="/projects">Projects</Nav.Link>}
          {logged && <Nav.Link href="/tasks">Tasks</Nav.Link>}
          {logged && isAdmin && <Nav.Link href="/users">Users</Nav.Link>}
        </Nav>
      </Container>
    </Navbar>
  );
};

export default Navigation;
